<area shape="rect" id="id2" href="Goal.html" title="Goal is an aim defined under a persona and its sub-types - engineer and organization. " alt="" coords="1378,2333,1436,2389"/>
<area shape="rect" id="id3" href="Topic.html" title="Topic is a group of related messages in a forum. " alt="" coords="527,556,589,612"/>
<area shape="rect" id="id4" href="Event.html" title="Event is a named temporal. " alt="" coords="574,401,636,457"/>
<area shape="rect" id="id5" href="Forum.html" title="Discussion forum which can contain sub-forums and discussion topics. " alt="" coords="379,401,447,457"/>
<area shape="rect" id="id6" href="Module.html" title="Module is a part of product or another module. " alt="" coords="683,2171,755,2227"/>
<area shape="rect" id="id7" href="Product.html" title="Product is an object or a system made available for consumer use. " alt="" coords="1269,2333,1343,2389"/>

<area shape="rect" id="id10" href="Persona.html" title="Personas represent represent the different types of consumers of products and services. " alt="" coords="1196,2171,1275,2227"/>
<area shape="rect" id="id11" href="Release.html" title="Release is a unit of delivering product features to its consumers. " alt="" coords="1367,2481,1446,2537"/>
<area shape="rect" id="id12" href="Directory.html" title="Directory is a container of named elements, e.g. documents, links, or other directories. " alt="" coords="220,2171,300,2227"/>
<area shape="rect" id="id13" href="Principle.html" title="Principles are general rules and guidelines, intended to be enduring and seldom amended, that inform and support the way in which an engineer or an organization sets about achieving its goals or addressing goals of their consumers modeled as personas..." alt="" coords="335,2171,415,2227"/>
<area shape="rect" id="id14" href="Objective.html" title="Objective is something that should be achieved as part of endeavor such as an increment or a release. " alt="" coords="882,711,964,767"/>
<area shape="rect" id="id15" href="Alignable.html" title="Something that can be aligned to aims by alignments - aims or endeavors." alt="" coords="1238,239,1323,295"/>
<area shape="rect" id="id16" href="Allocation.html" title="Allocation of engineer’s capacity to spend on a particular engineered element and issue category on a particular endeavor. " alt="" coords="525,2171,610,2227"/>
<area shape="rect" id="id17" href="Increment.html" title="Increment is a period of time to plan releases and schedule issues for. " alt="" coords="1051,2598,1138,2654"/>
<area shape="rect" id="id18" href="Link.html" title="Link to an external URL. " alt="" coords="192,394,269,463"/>
<area shape="rect" id="id19" href="IssuePriority.html" title="Issue priority, e.g. Low, Medium, High. " alt="" coords="1167,1868,1267,1924"/>
<area shape="rect" id="id20" href="Organization.html" title="Organization is an engineer which can contain other engineers, and organizations as such. " alt="" coords="882,1868,983,1924"/>
<area shape="rect" id="id21" href="Message.html" title="A message in a discussion topic authored by an engineer on a specific date." alt="" coords="579,704,662,773"/>
<area shape="rect" id="id22" href="IssueSeverity.html" title="Issue severity, e.g. Feature, Minor, Major, Crash. " alt="" coords="408,1868,513,1924"/>
<area shape="rect" id="id23" href="Alignment.html" title="An association class between aims and engineered capabilities. " alt="" coords="1349,549,1436,618"/>
<area shape="rect" id="id24" href="NamedElement.html" title="Named element, as the name suggests, is a base class for model elements with a name." alt="" coords="658,239,777,295"/>
<area shape="rect" id="id25" href="IssueStatus.html" title="Issue status, e.g. Open, In Progress, Done. " alt="" coords="1302,1861,1400,1930"/>
<area shape="rect" id="id26" href="Capability.html" title="Capability is something that can be required by an issue to start working on it. " alt="" coords="561,866,663,935"/>
<area shape="rect" id="id27" href="EngineeredElement.html" title="Engineered element is something that is “brought about” by engineers working on issues associated with the engineered element. " alt="" coords="563,2023,705,2079"/>

<area shape="rect" id="id34" href="Endeavor.html" title="Endeavor is a base class for things which take time, effort, and money to achieve some benefit - increments, and engineered capabilities - issues, features, and releases. " alt="" coords="870,852,975,949"/>
<area shape="rect" id="id35" href="Decision.html" title="Decision is an issue, which is also an aim, i.e. endeavors, such as issues, and other aims such as other decisions may be aligned to it. " alt="" coords="291,1495,400,1593"/>
